import React, { Component } from 'react';
import styled from 'styled-components';

const Page = styled.div`
  display: flex;
  flex-flow: column nowrap;
`;

const Background = styled.div`
  position: fixed;
  top: 0;
  right: 0;
  left: 0;
  bottom: 0;
  z-index: -1;
  background-image: url("https://images.unsplash.com/photo-1424847651672-bf20a4b0982b?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1650&q=80");
`;

const Section = styled.div`
  display: flex;
  flex-flow: row nowrap;
  align-items: center;
  justify-content: center;
  height: 100%;
  min-height: 100vh;
`;

const Title = styled.h1`
  font-size: 4rem;
  font-weight: bold;
  color: #fff;
`;

const Card = styled.div`
  display: flex;
  flex-flow: column nowrap;
  flex: .5;
  background: #000;
`;

const Demo = styled.div`
  flex: .5;

`;

class Index extends Component {

  render() {
    return (
      <Page className="sweetmenu">
        <Background />
        <Section className="sweetmenu__hero">
          <Title className="sweetmenu__hero--title">
            Grow your <u>brunch spot</u>.
          </Title>
        </Section>
        <Section className="sweetmenu__intro">
          <Card className="sweetmenu__intro--card">
            <Title>
              Turn <u>browsers</u> into <u>diners</u>.
            </Title>
          </Card>
          <Demo className="sweetmenu__intro--demo">
          </Demo>
        </Section>
      </Page>
    );
  }

}

export default Index;
